import Books from "./Books";
import { Container } from "@material-ui/core";
import Movies from "./Movies";

function App() {
  return (
    <div className="App">
      <Container maxWidth="md">
        <h2>All Books</h2>
        <Books/>
        <br/><br/>
        <h2>All Movies</h2>
        <Movies/>
      </Container>
    </div>
  );
}

export default App;
